/* Function  structure for function  `MyRound` */

/*!50003 DROP FUNCTION IF EXISTS `MyRound` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `MyRound`(Operand DOUBLE,Places INTEGER) RETURNS double
    DETERMINISTIC
BEGIN
DECLARE x DOUBLE;
DECLARE i INTEGER;
DECLARE ix DOUBLE;
  SET x = Operand*POW(10,Places);
  SET i=x;
  
  IF (i-x) >= 0.5 THEN                   
    SET ix = 1;                  
  ELSE
    SET ix = 0;                 
  END IF;     
  SET x=i+ix;
  SET x=x/POW(10,Places);
RETURN x;
END */$$
DELIMITER ;

/* Procedure structure for procedure `CustOrderHist` */

/*!50003 DROP PROCEDURE IF EXISTS  `CustOrderHist` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CustOrderHist`(in AtCustomerID varchar(5))
BEGIN
SELECT ProductName,
    SUM(Quantity) as TOTAL
FROM Products P,
     `Order Details` OD,
     Orders O,
     Customers C
WHERE C.CustomerID = AtCustomerID
  AND C.CustomerID = O.CustomerID
  AND O.OrderID = OD.OrderID
  AND OD.ProductID = P.ProductID
GROUP BY ProductName;
END */$$
DELIMITER ;

/* Procedure structure for procedure `CustOrdersOrders` */

/*!50003 DROP PROCEDURE IF EXISTS  `CustOrdersOrders` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CustOrdersOrders`(in AtCustomerID varchar(5))
BEGIN
      SELECT OrderID,
	OrderDate,
	RequiredDate,
	ShippedDate
FROM Orders
WHERE CustomerID = AtCustomerID
ORDER BY OrderID;
END */$$
