END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_employees_rank` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_employees_rank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_employees_rank`()
BEGIN
select *
     from (select a.Title, a.EmployeeID, a.FirstName, a.Salary,
                  (select 1 + count(*)
                   from Employees b
                   where b.Title = a.Title
                     and b.Salary > a.Salary) RANK
           from Employees as a) as x
     order by x.Title, x.RANK;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_employees_rollup` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_employees_rollup` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_employees_rollup`()
BEGIN
SELECT Distinct City ,Sum(Salary) Salary_By_City FROM employees
GROUP BY City WITH ROLLUP;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_employees_rownum` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_employees_rownum` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_employees_rownum`()
BEGIN
SELECT *
FROM
(select @rownum:=@rownum+1  as RowNum,
  p.* from employees p
   ,(SELECT @rownum:=0) R
   order by firstname desc limit 10
) a
WHERE a.RowNum >= 2 AND a.RowNum<= 4;
END */$$
DELIMITER ;

